@julien777z @Rockerite_ @BSlickComposer The difference between platforms like Steam and Roblxo are:

Steam: High cut of the profit, but requires the developer to take care of game servers, databases, app store fees, engine fees, etc.

Roblox: Low cut of the profit, but takes care of the aforementioned things.
